import React from 'react';

class LandingPage extends React.Component {


  state = {
  }

  onGetStarted = () => {
    this.props.history.push('/getstarted')
  }



  render(){
    return (
      <div className="App">
          <h1> Welcome! </h1>
          <button onClick={this.onGetStarted}> Get Started </button> 
          <div> {this.state.label} </div>

      </div>
    );
  }

}

export default LandingPage;
